import * as React from 'react';
import JqxPanel from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxpanel';
import JqxInput, { IInputProps } from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxinput';
import JqxPasswordInput, { IPasswordInputProps } from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxpasswordinput';

class dvlogin extends React.Component<{}, IInputProps, IPasswordInputProps> {
    constructor(props: {}) {
            super(props);
            this.state = {
            source: ["Afghanistan"]
        }
    }

    public render() {
        return (
            <JqxPanel width={350} height={350} >
                <div style={{ margin: '10px' }}>
                    <h1>DeskVantage Login</h1>
                    <JqxInput
                        width={200} height={25} 
                     minLength={1} placeHolder={'Enter a Username'} />

                     <JqxPasswordInput
                        width={200} height={25} placeHolder={'Enter password'}
                        showStrength={true} showStrengthPosition={'right'} />
                </div>
            </JqxPanel>
        );
    }
}
export default dvlogin;
